    [],nt"num_tags": 9,nt"name": "environmental-assessment-marais-des-cygnes-national-wildlife-refuge-tree-stands",nt"isopen":
    false,nt"url": null,nt"notes": "This Environmental Assessment is to evaluate
    whether current regulations regarding tree stands on the Marais des Cygnes National
    Wildlife Refuge are sufficient or should be changed.  This evaluation was accomplished
    by reviewing current laws, regulations, and policies as well as working with the
    public.  The proposed action is to require the removal of tree stands daily from
    the refuge.  The intent of the proposed regulation change is to provide a quality
    hunting program that is equally accessible to all hunters throughout the season.
     This environmental assessment contains the Finding of No Significant Impact and
